    <p style=margin:0in;margin-bottom:.0001pt;font-size:15px;font-family:&quot;Helvetica Neue&quot;,&quot;serif&quot;;color:black;border:none;margin-left:22.5pt;><span style=font-size:16px;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;color:#333333;background:#F8F8F8;>You are given an array <strong>A</strong> consisting of strings made up of the letters ‘a’ and ‘b’ only.&nbsp;</span></p>
