    <p style=margin:0in;margin-bottom:.0001pt;font-size:15px;font-family:&quot;Helvetica Neue&quot;,&quot;serif&quot;;color:black;border:none;margin-left:22.5pt;><span style=font-size:16px;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;color:#333333;background:#F7F7F7;>1.&nbsp;&nbsp;At time 1, you circularly rotate each string by 1 letter.</span></p>
    <p style=margin:0in;margin-bottom:.0001pt;font-size:15px;font-family:&quot;Helvetica Neue&quot;,&quot;serif&quot;;color:black;border:none;margin-left:22.5pt;><span style=font-size:16px;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;color:#333333;background:#F7F7F7;>2.&nbsp;&nbsp;At time 2, you circularly rotate the new rotated strings by 2 letters.</span></p>
    <p style=margin:0in;margin-bottom:.0001pt;font-size:15px;font-family:&quot;Helvetica Neue&quot;,&quot;serif&quot;;color:black;border:none;margin-left:22.5pt;><span style=font-size:16px;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;color:#333333;background:#F7F7F7;>3.&nbsp;&nbsp;At time 3, you circularly rotate the new rotated strings by 3 letters.</span></p>
    <p style=margin:0in;margin-bottom:.0001pt;font-size:15px;font-family:&quot;Helvetica Neue&quot;,&quot;serif&quot;;color:black;border:none;margin-left:22.5pt;><span style=font-size:16px;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;color:#333333;background:#F7F7F7;>4.&nbsp;&nbsp;At time i, you circularly rotate the new rotated strings by i % length(string) letters.</span></p>
    <p style=margin:0in;margin-bottom:.0001pt;font-size:15px;font-family:&quot;Helvetica Neue&quot;,&quot;serif&quot;;color:black;border:none;margin-left:22.5pt;><span style=font-size:16px;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;color:#333333;background:#F7F7F7;>&nbsp;</span></p>
