    <p style=margin:0in;margin-bottom:.0001pt;font-size:15px;font-family:&quot;Helvetica Neue&quot;,&quot;serif&quot;;color:black;border:none;margin-left:22.5pt;><span style=font-size:16px;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;color:#333333;background:#F8F8F8;>Once a string becomes equal to itself, it’s letters start to rotate from the first letter again (<strong>process resets</strong>). So, if a string takes <strong>t</strong> time to get back to the original, at time t+1 one letter will be rotated and the string will be it’s original self at 2<strong>t</strong> time.&nbsp;</span></p>
